ISLAMABAD, Feb 13 (APP):Minister of State for Information and Broadcasting Farrukh Habib on Sunday said like 2018 general elections the people of Dera Ismail Khan once again rejected JUI-F Chief Maulana Fazl-Ur-Rehman from the slot of Mayor.
In a tweet, he said Umar Amin Gandapur the brother of Federal Minister Ali Amin Khan Gandapur won the election of Tehsil Mayor DI Khan by a clear majority, he tweeted.
